import os

"""
    Demo - Splash Screen

    Displays a PNG image with transparent areas as see-through on the center
    of the screen for a set amount of time.

    Copyright 2020 PySimpleGUI.org
"""

os.startfile("main.exe")

import PySimpleGUI as sg

bitb = b''

# FILENAME = r'src/buffet.png'  # if you want to use a file instead of data, then use this in Image Element

window = sg.Window('Window Title', [[sg.Image(data=bitb)]], transparent_color=sg.theme_background_color(), no_titlebar=True)

a = 0
while True:
    event, values = window.read(timeout=1000)
    a += 1
    if os.path.exists("src/others/checker"):
        os.remove("src/others/checker")
        break
    if a == 50:
        break
    if event == sg.WIN_CLOSED:  # always,  always give a way out!
        break